msItem.colophon:
Þeir bæir sem hér að framan í sögunni eru nefndir eru enn að vísu byggðir, nokkrir á Síðu í Vestur-Skaftafellssýslu, og er það þá það mesta sem mun vera sögunni til sanninda, en þó ekki sé svo mikið af því ótrúanlega utan um Fálu og Gálu og flögðin í Grönlandi, en þó menn viti að frá stórmennum er sagt víða, og Golíat munu flestir trúa að til hafi verið. Skrifuð á Reykjafjarðar höndlunarstað árið 1826 af I.S. (
39r-39v
)
